import { useState } from 'react'
import Header from './components/Header'
import Weekdays from './components/Weekdays'
import { FaSnowflake } from 'react-icons/fa'
import { IoRainy } from 'react-icons/Io'

const App = () => {
const [weekdays, setWeather] = useState(
  [
    {
      id: 1,
      day: 'Sunday',
      weatherType: 'Snow',
      picture: <FaSnowflake />,
    },
    {
      id: 2,
      day: 'Monday',
      weatherType: 'Rain',
      picture: <IoRainy />,
    },
    {
      id: 3,
      day: 'Tuesday',
      weatherType: 'Cloudy',
      picture: null,
    },
    {
      id: 4,
      day: 'Wednesday',
      weatherType: 'Cloudy',
      picture: null,
    },
    {
      id: 5,
      day: 'Thursday',
      weatherType: 'Cloudy',
      picture: null,
    },
    {
      id: 6,
      day: 'Friday',
      weatherType: 'Cloudy',
      picture: null,
    },
    {
      id: 7,
      day: 'Saturday',
      weatherType: 'Cloudy',
      picture: null,
    }
  ]
)
  return (
    <div className="container">
      <Header />
      <div className="week">
        <Weekdays weekdays={weekdays} />
      </div>
    </div>
  )
}

export default App;
